function isValid(s) {
    if (s.length ==1) return 'YES';
    //s = 'xxxaabbccrry';
    let charCount = {};
    for (let char of s){
        charCount[char] = charCount[char] ==undefined? 1: charCount[char]+1;
    }
    let val = Object.values(charCount);
    console.log(charCount);
    
    let min = Math.min(...val);
    let max = Math.max(...val);
    let minLen = val.filter(value=>value==min).length;
    let maxLen = val.filter(value=>value==max).length;
    //console.log(minLen);
    //console.log(maxLen);
    if (max == min) return 'YES';
    if (minLen>1&&maxLen>1) return 'NO';
    if(minLen*min+maxLen*max!=s.length) return 'NO';
    if (maxLen == 1 && min == 1 && minLen==1) return 'YES'
    if (minLen>1 && max-min>1 ) return 'NO';
    

    return 'YES';

}

let w = '';

